import React, { Component } from 'react';
export default class AboutME extends Component {
    render() {
        return (
            <React.Fragment>
                <section id="aboutME" className="s-about target-section">
                    <div className="row narrow section-intro has-bottom-sep">
                        <div className="col-full text-center">
                            <h3>About Me</h3>
                            <h1>"A Renaissance Soul"</h1>
                            <p className="lead">I am a final year undergraduate having a keen interest in exploring everything. This website compiles my diverse experiences and ideas.</p>
                        </div>
                    </div>
                </section> {/* end about */}
                <section id="aboutME" className="s-about target-section">
                    <div className="row narrow section-intro has-bottom-sep">
                        <div className="col-full text-center">
                            <h3>About Me</h3>
                            <h1>"A Renaissance Soul"</h1>
                            <p className="lead">I am a final year undergraduate having a keen interest in exploring everything. This website compiles my diverse experiences and ideas.</p>
                        </div>
                    </div>
                </section> {/* end about */}

            </React.Fragment>
        );
    }
}
